import{_ as a}from"./plugin-vue_export-helper-c27b6911.js";import{o as e,c as h,f as r}from"./app-7aab27fa.js";const d={},i=r('<h2 id="_1-自我介绍" tabindex="-1"><a class="header-anchor" href="#_1-自我介绍" aria-hidden="true">#</a> 1.自我介绍</h2><p>面试官，您好。我叫杨路恒，今年25岁，就读于陕西师范大学，今年研三，软件工程专业，研究方向为知识图谱。大学时间到研究生期间的主要技术栈是Java 。在校期间参与了全国大学生数学建模竞赛和全国大学生英语竞赛，并且在数学建模比赛中担任队长并获得了陕西省一等奖。同时获得了全国大学生英语竞赛陕西省二等奖。最近上个月获得了研究生国家奖学金。另外最近一段在联想实习的经历，主要是对大模型进行开发应用。说到业余爱好的话，一个是比较喜欢通过博客整理分享自己所学知识，现在在CSDN上的访问量达到了50W+。 另一个是喜欢旅游和骑行的方式来放松。这就是我的自我介绍，感谢。</p><h2 id="_2-团队中有矛盾-怎么解决的经历" tabindex="-1"><a class="header-anchor" href="#_2-团队中有矛盾-怎么解决的经历" aria-hidden="true">#</a> 2.团队中有矛盾，怎么解决的经历</h2><p>本科的时候，担任队长参加全国大学生数学建模竞赛，分工这一块起了冲突，有人想要写论文，有人想要写代码，有人想要建模。</p><p>根据每个人的特长进行分工，数学学院的同学擅长建模，让他负责建模。我和另一个负责论文主要内容和代码编写。一些需要协调的任务可以共同解决。定期与团队成员进行反馈，了解任务进展情况，根据需要进行调整。这有助于避免问题的积累。</p><h2 id="_3-问了自己的项目" tabindex="-1"><a class="header-anchor" href="#_3-问了自己的项目" aria-hidden="true">#</a> 3.问了自己的项目</h2><h2 id="_4-终面-4v4面试-问一些简单的技术-再问一些实习-愿不愿意调岗这些" tabindex="-1"><a class="header-anchor" href="#_4-终面-4v4面试-问一些简单的技术-再问一些实习-愿不愿意调岗这些" aria-hidden="true">#</a> 4.终面，4v4面试，问一些简单的技术，再问一些实习，愿不愿意调岗这些</h2><p>技术相关的岗位可以调岗。</p><h2 id="_5-为什么不去大厂来这里" tabindex="-1"><a class="header-anchor" href="#_5-为什么不去大厂来这里" aria-hidden="true">#</a> 5.为什么不去大厂来这里</h2><p>大厂工作强度以及不稳定。个人的职业规划是偏向稳定以及wlb。</p><h2 id="_6-有什么数据挖掘的经验" tabindex="-1"><a class="header-anchor" href="#_6-有什么数据挖掘的经验" aria-hidden="true">#</a> 6.有什么数据挖掘的经验</h2><h2 id="_7-非科班出身-优势和劣势" tabindex="-1"><a class="header-anchor" href="#_7-非科班出身-优势和劣势" aria-hidden="true">#</a> 7.非科班出身，优势和劣势</h2><p>优势：科班出身，对于计算机的基础知识熟悉。独立做过项目，以及做过实际的和公司合作的项目。发表过中科院一区论文，对前沿领域有了解。</p><p>劣势：在计算机领域有广泛知识，但缺少对其他领域的了解。</p><h2 id="_8-怎么看待加班" tabindex="-1"><a class="header-anchor" href="#_8-怎么看待加班" aria-hidden="true">#</a> 8.怎么看待加班</h2><p>公司有业务上线或紧急情况，加班是正常的。</p><h2 id="_9-数据库了解多少" tabindex="-1"><a class="header-anchor" href="#_9-数据库了解多少" aria-hidden="true">#</a> 9.数据库了解多少</h2><h2 id="_10-个人的兴趣爱好是什么" tabindex="-1"><a class="header-anchor" href="#_10-个人的兴趣爱好是什么" aria-hidden="true">#</a> 10.个人的兴趣爱好是什么</h2><p>骑行、爬山</p><h2 id="_11-介绍一下自己和目标岗位的项目-遇到了什么难点-怎么解决的-事情结束后再回想有没有新的更好的思路" tabindex="-1"><a class="header-anchor" href="#_11-介绍一下自己和目标岗位的项目-遇到了什么难点-怎么解决的-事情结束后再回想有没有新的更好的思路" aria-hidden="true">#</a> 11.介绍一下自己和目标岗位的项目 遇到了什么难点 怎么解决的 事情结束后再回想有没有新的更好的思路？</h2><p>公司实习的项目，对话机器人项目，遇到的难点是如何进行自动根据场景多轮对话，知道给出满意答案。解决方法后台调用开源大模型生成对应问题，并根据历史对话判断是否需要提出新的问题或完成对话。事情结束后更好的思路，利用大模型的自主代理。</p><h2 id="_12-用两个正向词、两个负向词形容自己" tabindex="-1"><a class="header-anchor" href="#_12-用两个正向词、两个负向词形容自己" aria-hidden="true">#</a> 12.用两个正向词、两个负向词形容自己</h2><p>正向词1:勤奋 - 我是一个勤奋好学的人,不断努力提升自己的能力。</p><p>正向词2:乐观 - 我性格乐观开朗,善于发现事物积极的一面。</p><p>负向词1:偶尔惰性 - 有时会出现一点惰性,但我会及时调整自己的状态。</p><p>负向词2:过于谨慎 - 对重要事情会比较谨慎,需要花时间深思熟虑。</p><h2 id="_13-数字产品经理的职责" tabindex="-1"><a class="header-anchor" href="#_13-数字产品经理的职责" aria-hidden="true">#</a> 13.数字产品经理的职责</h2><h2 id="_14-是否接受调剂" tabindex="-1"><a class="header-anchor" href="#_14-是否接受调剂" aria-hidden="true">#</a> 14.是否接受调剂</h2><h2 id="_15-为什么来上海" tabindex="-1"><a class="header-anchor" href="#_15-为什么来上海" aria-hidden="true">#</a> 15.为什么来上海？</h2><p>从西安到上海大老远跑过来，确实是想来这边工作。正好对象在上海海事读研二，打算读博，想着毕业能在一个城市。然后姑姑家在这，前段时间生病了，正好顺道来看看。</p><p>2022.5.20</p><p>539天</p><p>11.13</p><h2 id="_16-为什么选择上海农商-你对上海农商的了解" tabindex="-1"><a class="header-anchor" href="#_16-为什么选择上海农商-你对上海农商的了解" aria-hidden="true">#</a> 16.为什么选择上海农商？你对上海农商的了解？</h2><p>上海农村商业银行股份有限公司成立于2005年8月25日，是由国资控股、总部设在上海的法人银行，也是全国首家在农信基础上改制成立的省级股份制商业银行。2021年8月19日，上海农商银行在上海证券交易所上市，股票简称：沪农商行，股票代码：601825。</p><p>在全国农商银行中排名第二。</p><p>选择上海农商，一是工作地点符合预期，二是职业目标倾向于稳定的平台，上海农商在上海也很有名，前景也很好，三是面试机会来之不易。</p>',37),n=[i];function _(t,c){return e(),h("div",null,n)}const o=a(d,[["render",_],["__file","整理-上海农商银行面经.html.vue"]]);export{o as default};
